    };

    const root = j(fileInfo.source);
    const tNodes = root.find(j.Node).filter((nodePath: any) => needsTransform(nodePath));

    // bops
    const bopNodes = tNodes.find(j.BinaryExpression);
    transNodes(bopNodes);
    // uops
    const uopNodes = tNodes.find(j.UnaryExpression);
    transNodes(uopNodes);
